import * as React from "react";
import avatar from "../../Images/girl-coder.png";
import "./Avatar.css";

function Avatar() {
  return (
    <div className="Image">
      <h2>Hey there, I'm Mariana.</h2>
      <img className="avatar" src={avatar} alt="Avatar" />
    </div>
  );
}

export default Avatar;
